import withAuth from '../AuthChecker';
import { useNavigate } from 'react-router-dom';
import React from 'react';
import { Button} from '@mui/material';
import {StyledDialog,StyledDialogTitle,StyledDialogContent} from "./OrdeDetails.style"

interface Product {
  _id: string;
  BuyerName: string;
  SellerName: string;
  UnitPrice: number;
  TotalUnits: number;
  Tenure: number;
  RemainingUnits: number;
  ImageSeller: string;
  ImageBuyer: string;
  Xirr: number;
  ID: string;
}

interface OrderDetailsPopupProps {
  open: boolean;
  onClose: () => void;
  product: Product | null;
  units: number;
}


const OrderDetailsPopup: React.FC<OrderDetailsPopupProps> = ({ open, onClose, product, units }) => {
  const navigate = useNavigate();

  const handleClose = () => {
    onClose();
    navigate('/dashboard');
  };

  if (!product) return null;

  return (
    <StyledDialog open={open} onClose={handleClose}>
      <StyledDialogTitle>Order Details</StyledDialogTitle>
      <StyledDialogContent>
       
      </StyledDialogContent>
      <StyledDialogActions>
        <Button onClick={handleClose} variant="contained" >
          Close
        </Button>
      </StyledDialogActions>
    </StyledDialog>
  );
};

export default withAuth(OrderDetailsPopup);
